r($,"bO6","bi9",()=>A.a([A.aGe("Social Solver es una plataforma de innovaci\xf3n abierta para el impacto social impulsada por Ayuda en Acci\xf3n. Tiene por objetivo romper la brecha de la innovaci\xf3n, haci\xe9ndola llegar a aquellas poblaciones y territorios m\xe1s vulnerables del planeta, con el fin \xfaltimo de contribuir a generar oportunidades y mejorar sus condiciones de vida.","\xbf Qu\xe9 es Social Solver ?"),A.aGe("Tenemos una metodolog\xeda propia. Partiendo siempre de la escucha a las comunidades, identificamos de forma participativa una problem\xe1tica o reto que suponga un freno al desarrollo de una comunidad. Este reto lo definimos y planteamos en nuestra plataforma digital para que los equipos de Solvers respondan con sus soluciones innovadoras. Analizamos todas las respuestas y co-creamos la mejor soluci\xf3n, m\xe1s adaptada y sostenible. Cuando la tenemos, pasamos a la fase de pilotaje para evaluar con evidencia si la soluci\xf3n responde realmente al reto planteado. Este pilotaje nos permite medir el impacto, escalar y replicar la soluci\xf3n. Sabemos que la mayor\xeda de los problemas ambientales y sociales son globales, y nos centramos en que las innovaciones sociales puedan replicarse en otros lugares y escalarse.","\xbf C\xf3mo funciona Social Solver ?"),A.aGe("Orientamos la innovaci\xf3n hacia la transformaci\xf3n social, para resolver problemas sociales, atendiendo a los \xe1mbitos \xe9ticos, medioambientales y econ\xf3micos. Nos apoyamos en modelos de innovaci\xf3n abierta, incorporando o mezclando conocimiento externo con el existente internamente, generando aprendizaje de forma m\xe1s eficiente.","\xbf Qu\xe9 es la innovaci\xf3n social ?"),A.aGe("En Social Solver tenemos siempre en cuenta la sostenibilidad econ\xf3mica y viabilidad a largo plazo, enfatizando en la autosuficiencia y el desarrollo local, con un enfoque de Innovaci\xf3n Frugal.","\xbf Qu\xe9 es la innovaci\xf3n frugal ?")],A.ai("F<a5e>")))
